import React from 'react'
import {
    PieChart,
    Pie,
    ResponsiveContainer,
} from 'recharts'

const data01 = [
    {
      "name": "Mujeres",
      "value": 400
    },
    {
      "name": "Hombres",
      "value": 300
    },
    {
      "name": "No binario",
      "value": 300
    },
    {
      "name": "Otros",
      "value": 200
    }
  ];



export default function CircularGraph() {
    return (

            <PieChart>
                <Pie
                    dataKey="value" 
                    nameKey="name" 
                    cx="50%" 
                    cy="50%" 
                    outerRadius={50} 
                    fill="#8884d8" 
                    data={data01}
                >
                </Pie>
            </PieChart>
    )
}
